import Link from "next/link";
import Image from "next/image";

const HeaderNuevo = () => {
  return (
    <>
      <nav className="navbar-yesmom">
        <Link href="/">
          <a>
            <Image
              src="/image/header/logo-yesmom.svg"
              alt="logo yesmom"
              width={70}
              height={70}
              // layout="responsive"
            />
          </a>
        </Link>
      </nav>
      <style jsx>
        {`
          .navbar-yesmom {
            display: flex;
            align-items: center;
            flex-wrap: wrap;
            padding: 1rem 4rem;
          }
        `}
      </style>
    </>
  );
};

export default HeaderNuevo;
